import React from "react";
import "./css/Patners.css";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import Carousel from "nuka-carousel";
import { AiOutlineLeft, AiOutlineRight } from "react-icons/ai";
import { patnerLogos } from "../Data";

const Patners = () => {
  var settings = {
    speed: 500,
    slidesToShow: 5,
    slidesToScroll: 4,
    dots: true,
    infinite: true,
  };
  return (
    <div className="patners__container">
      <div className="header__container">
        <h1>Our patners</h1>
      </div>
      <div className="logos__container">
        <Carousel
          slidesToShow={4}
          dragging={true}
          cellAlign="center"
          renderCenterLeftControls={({ previousSlide }) => (
            <AiOutlineLeft
              className="ai__left__arrow"
              onClick={previousSlide}
            />
          )}
          renderCenterRightControls={({ nextSlide }) => (
            <AiOutlineRight className="ai__right__arrow" onClick={nextSlide} />
          )}
        >
          {patnerLogos.map(({ path }) => (
            <div className="logo__container">
              <img src={path} alt="" className="logo__img" />
            </div>
          ))}
        </Carousel>
      </div>
    </div>
  );
};

export default Patners;
